import React, { useState } from 'react';

function Testing(props) {

    const [name, setName] = useState("Akshat")

    const changeName=()=>
    {
        setName("Akshat Sharma")
    }


    




    return (
        <div>
            <h1>{name}</h1>
            <button className='btn btn-light' onClick={changeName}>Change</button>
        </div>
    );
}

export default Testing;
